import { useState } from "react";
import { getPrediction } from "../api/predict";
import "../styles/SessionResults.css";

function SessionResult() {
  const [result, setResult] = useState(null);

  const handlePredict = async () => {
    const sessionData = {
      duration: 25,
      switch_count: 3,
      switch_rate: 0.12,
      active_ratio: 0.85
    };

    const res = await getPrediction(sessionData);
    setResult(res);
  };

  return (
    <div className="app-container">
      <div className="card">
        <h2>AI Focus Analyzer</h2>

        <button className="analyze-btn" onClick={handlePredict}>
          Analyze Session
        </button>

        {result && (
          <div className="result">
            <div
              className={`badge ${
                result.prediction === 1 ? "distracted" : "focused"
              }`}
            >
              {result.prediction === 1 ? "Distracted" : "Focused"}
            </div>

            <div className="confidence">
              Confidence: {Math.round(result.confidence * 100)}%
            </div>

            <div className="progress-bar">
              <div
                className="progress-fill"
                style={{ width: `${result.confidence * 100}%` }}
              />
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

export default SessionResult;
